import React from 'react';

const VideoContent = ({ content }) => {
  const { title, url } = content
  return (
    <div className="content-box">
      <h3>{title}</h3>
      <video controls>
        <source src={url} type="video/mp4" />
        Your browser does not support the video tag.
      </video>
    </div>
  );
};

export default VideoContent;
